import React from "react";

// reactstrap components
import { Card, CardBody, CardTitle, CardHeader, Table, Container, Media, Row, Col, Progress, Button} from "reactstrap";
import Chart from "chart.js";
import { Line, Bar } from "react-chartjs-2";
import PostAnalytics from "./PostAnalytics";
import AnalyticsHeader from "components/Headers/AnalyticsHeader.js";

// core components
import {
  chartOptions,
  parseOptions,
  chartExample1,
  chartExample2
} from "variables/charts.js";

class Analytics extends React.Component {

  constructor() {
    super();
    this.state = {
      analytics: {},
      activeNav: 1,
      chartExample1Data: "data1"
    };
    if (window.Chart) {
      parseOptions(Chart, chartOptions());
    }
  }

  render() {

    return (
      <>
        <div className="header pt-7 pb-8 " style={{ paddingLeft: '39px', paddingRight: '39px', height: '30%'}}>
            <AnalyticsHeader />
            <PostAnalytics />
        </div>
      </>
    );
  }
}

export default Analytics;
